import React, { useState } from "react";
import InputComponent from "./Input";

export default function RegisterComponents() {
    const [cpf, changeCPF] = useState("");

    return (
        <div>
            <InputComponent
                type="text"
                id="name"
                description="Nome"
                placeholder="NomeFantasia"
            />
            <InputComponent
                type="text"
                id="cpf"
                description="CPF"
                placeholder="000.000.000-00"
                value={cpf}
                onChange={(e) => changeCPF(e.target.value)}
            />
            <InputComponent
                type="password"
                id="password"
                description="Senha"
                placeholder="********"
            />
        </div>
    );
}
